ks side-by-side in a playlist he recognised a synergy, and the outline of the project began to take shape. The result is more of a continuous soundscape than an album; an ethereal and dreamy experience designed toaccompany the listener as they turn inward and drift away. If club music is a form of escape, then this is too  but instead of turning outward, we lose ourselves inward.logseq____&quot;,536870967]],[logseq____&quot;^15logseq____&quot;,[1891,logseq____&quot;^Ologseq____&quot;,logseq____&quot;^16logseq____&quot;,536870967]],[logseq____&quot;^15logseq____&quot;,[1891,logseq____&quot;^Flogseq____&quot;,1890,536870967]],[logseq____&quot;^15logseq____&quot;,[1891,logseq____&quot;^Xlogseq____&quot;,95,536870967]],[logseq____&quot;^15logseq____&quot;,[1891,logseq____&quot;^Vlogseq____&quot;,95,536870967]],[logseq____&quot;^15logseq____&quot;,[1891,logseq____&quot;^Ulogseq____&quot;,95,536870967]],[logseq____&quot;^15logseq____&quot;,[1891,logseq____&quot;^Ulogseq____&quot;,1888,536870967]],[logseq____&quot;^15logseq____&quot;,[1891,logseq____&quot;^Hlogseq____&quot;,1888,536870967]],[logseq____&quot;^15logseq____&quot;,[1891,logseq____&quot;^;logseq____&quot;,logseq____&quot;~u6722f735-fbc3-4e66-96e8-a7f48e793357logseq____&quot;,536870967]],[logseq____&quot;^15logseq____&quot;,[1892,logseq____&quot;^Qlogseq____&quot;,logseq____&quot;The first single is Silhouette. Its a melancholy, atmospheric track with hints of 80s nostalgia and smooth as glass vocals from Sansa. The track conjures up images of vast and endless landscapes; the sense of space enhanced by sparse chord-changes and field recordings of heavy rain. Silhouette is so human it feels like an extension of an emotion, and Yotto says the idea came to him like a dream. A sound drifted towards him one day and he caught it by the tail and built on top of it until it became the entity he envisioned. Its slow and steady and it grows. I think the beauty lies in the simplicity of it.logseq____&quot;,536870967]],[log
